import React from 'react'
import Container from 'react-bootstrap/Container';
import { useDispatch, useSelector } from 'react-redux';
import styled from 'styled-components';
import Item from '../components/Item';
import leftbg from "../assets/images/left-bg.png";
import { useEffect } from 'react';
import { getStudent } from '../redux/actions/studentActions';
import Typography from '@mui/material/Typography';




const Stream = () => {
  const Streamwrapper=styled.div`
    position: relative;
    background-color: white;
    background-image: url(${leftbg});
    background-size: contain;
    background-repeat: no-repeat;
    background-position: left;

    .streamwrapper{
      h3{
        color:${({theme})=>theme.colors.headeractive};
        font-family:inherit;
        margin:0!important;
      }
      span{
        color:${({theme})=>theme.colors.text7};
        position: relative;
        font-size:14px;
      }
    }
  `

  //fetch student details
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getStudent());
  }, []);

  
//get student list from store
const studentList = useSelector((state) => {
  return state.student;
});


console.log('stream pages');

const groupArea = studentList.reduce((acc,value)=>{
  (acc[value.group]=acc[value.group] || []).push(value);
    return acc
},[])

console.log('keys');
const keysvalue = Object.keys(groupArea);
console.log(keysvalue);

console.log("primary_stage");
console.log(groupArea.primary_stage);

console.log("middle_stage");
console.log(groupArea.middle_stage);

console.log("secondary_stage");
console.log(groupArea.secondary_stage);

console.log("higher_secondary");
console.log(groupArea.higher_secondary_stage);

console.log("graduate");
console.log(groupArea.graduate);

console.log("post graduate");
console.log(groupArea.post_graduate);

console.log("higher_secondary");
console.log(groupArea.higher_secondary_stage);

console.log("medical_science");
console.log(groupArea.medical_science);

console.log("engineering");
console.log(groupArea.engineer);





return (
    <Streamwrapper>
      <Container className='streamwrapper common_margin'>
     
        <Typography variant="h3" className='mt-3'>Primary stage</Typography>
        <span>std 1 to 4</span>
        <div className="item_container">
        {
          groupArea.primary_stage.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>

        <Typography variant="h3" className='mt-3'>Middle stage</Typography>
        <span>std 5th to 7th</span>
        <div className="item_container">
        {
          groupArea.middle_stage.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>

        <Typography variant="h3" className='mt-3'>secondary stage</Typography>
        <span>std 8th to 10th</span>
        <div className="item_container">
        {
          groupArea.secondary_stage.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>

        <Typography variant="h3" className='mt-3'>Higher secondary stage</Typography>
        <span>std 11th to 12th</span>
        <div className="item_container">
        {
          groupArea.higher_secondary_stage.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>

        <Typography variant="h3" className='mt-3'>graduate</Typography>
        <span>Graduate</span>
        <div className="item_container">
        {
          groupArea.graduate.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>

        <Typography variant="h3" className='mt-3'>post graduate</Typography>
        <span>Graduate</span>
        <div className="item_container">
        {
          groupArea.graduate.map((val, idx) => {
            return <Item key={idx} id={idx} data={val} />;
          })
        }
        </div>
      </Container>
    </Streamwrapper>
  )
}

export default Stream
